// Popup.js
import React, { useState } from 'react';
import Modal from 'react-modal';
import '../App.css';

Modal.setAppElement('#root'); // Set the root element for accessibility

const customModalStyles = {
    overlay: {
      backgroundColor: 'rgba(0, 0, 0, 0.92)', // Adjust the transparency here
    },
    content: {
      border: 'none',
      background: 'none',
      padding: '20px',
      width: '50%',
      margin: 'auto',
    },
  };

const Popup = () => {
  const [isOpen, setIsOpen] = useState(true);

  const closeModal = () => {
    setIsOpen(false);
  };

  return (
    <Modal
      isOpen={isOpen}
      onRequestClose={closeModal}
      contentLabel="Intro Modal"
      style={customModalStyles}
    >
      <h2>Torsgutta er i stor trengsel!</h2>
      <div className='info-container'>
        <h3>
            <span className='info-labelr'>Stad:</span> <span className="info-label">Kjøkkenet, Tors veg 12 </span> <br />
            <span className='info-labelr'>Stad:</span> <span className="info-label">6:58 </span> <br />
            Dato:<span className="info-label">30.11.23</span>  <br />
        </h3>
      </div>

      <p>Kulda beit godt fra seg, og det reiv i dei roseraude kinna hos dei barske, men skjøre gutevenane i den gamle leilegheita. Lite visste dei om kva som venta denne adventstida. Skrekkslagen vart Sverre idet han åpna kjøleskapet og såg at kanelen var stjålen. Skriket nådde kjellergutta, som i hu og hast sprang så fort at brørne Ingebrigtsen hadde lagt opp. Øystein derimot</p>
      <button onClick={closeModal}>Hjelp oss på vegen</button>
    </Modal>
  );
};

export default Popup;
